import React from "react";
import ExpenseItem from "./components/ExpenseItem/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        eDay={expenses[0].date.getDate()}
        eMonth={expenses[0].date.getMonth()}
        eYear={expenses[0].date.getFullYear()}
        eItem={expenses[0].title}
        eAmount={expenses[0].amount}
      />
      <ExpenseItem
        eDay={expenses[1].date.getDate()}
        eMonth={expenses[1].date.getMonth()}
        eYear={expenses[1].date.getFullYear()}
        eItem={expenses[1].title}
        eAmount={expenses[1].amount}
      />
      <ExpenseItem
        eDay={expenses[2].date.getDate()}
        eMonth={expenses[2].date.getMonth()}
        eYear={expenses[2].date.getFullYear()}
        eItem={expenses[2].title}
        eAmount={expenses[2].amount}
      />
      <ExpenseItem
        eDay={expenses[3].date.getDate()}
        eMonth={expenses[3].date.getMonth()}
        eYear={expenses[3].date.getFullYear()}
        eItem={expenses[3].title}
        eAmount={expenses[3].amount}
      />
    </div>
  );
}

export default App;
